import React from 'react';
import './App.css';
import Header from './components/Header';
import Todos from './components/Todos';
import Footer from './components/Footer';

const App = () => {
  let todos = [
    {
      sno: 1,
      title:"Have to go to the market..",
      desc:"Be careful You Have to go to the market as soon as possible"
    },
    {
      sno: 2,
      title:"Have to go to the School..",
      desc:"Be careful You Have to go to the market as soon as possible"
    },
    {
      sno: 3,
      title:"Have to go to the Tution..",
      desc:"Be careful You Have to go to the market as soon as possible"
    }
  ]
  return (
    <>
      <Header/>
      <Todos todos={todos}/>
      <Footer/>
      </>
  );
}

export default App;
